import React from 'react';
import styled from 'styled-components';

const StyledImageTile = styled.img`
  // height: 200px;
  // max-width: 400px;
  // border: 1px dashed blue;
`;

const StyledImageTileContainer = styled.img`
  height: 200px;
  max-width: 400px;
  border: 1px dashed blue;
  display: inline;
`;

const ImageTile = (props) => {
  const {imageData} = props;

  const handleImageClick = () => {
    console.log('-- CICK', imageData);
  }

  return <StyledImageTileContainer onClick={handleImageClick}><StyledImageTile src={`${imageData.links.download}`} /></StyledImageTileContainer>;
}

export default ImageTile;
